function App({detail}){
		const Say = (e) => { console.log(`hey my name is aakash bandhu aryal ${e}`)};
		
		return(
		<div>
		<h1>hey {detail[0]}</h1>
		<h2>hi {detail[1]}</h2>
		<button onClick={()=> Say(detail[0])}>reapot</button>
		</div>
		)
}
export default App;
